reen, 13th Gen Intel Evo Platform, 16GB RAM, 1TB SSD, 4GB Intel Arc A370M Graphics, Windows 11 Home, En -Ar KB, Nightfall black [7Q7A1EA]', 'Hp,laptop,16gbram,1tbrom,windows11,cheapprice,blackcolour,touchscreen', 0, NULL, 'abc.com', 2, 510.5, '1', 100, 1, 1, 0, 'abc.com', 10.00, 1, 5, 0, 1, 20.00000, '5', 2, '5', 1, '/backend/files/c6LmKrJ9BF4ykwn84TuQ.jpg', 1, 1, NULL, NULL),
