(15, NULL, 'Belkin USB C Portable Power Bank (10000 mAh with 1 Port and 2 A Ports for up to 15W Charging iPhone, Android, AirPods, iPad, More) – Black', 'belkin-usb-c-portable-power-bank-10000-mah-with-1-port-and-2-a-ports-for-up-to-15w-charging-iphone-android-airpods-ipad-more-black', '<ul><li><span style=\"color:rgb(15,17,17);\">Helps keep devices powered up and running for an extended period</span></li><li><span style=\"color:rgb(15,17,17);\">Charge at up to 15 Watt when using all 3 ports</span></li><li><span style=\"color:rgb(15,17,17);\">An LED light tells you the power bank\'s power status</span></li><li><span style=\"color:rgb(15,17,17);\">Compatible with USB-A and USB-C enabled devices</span></li><li><span style=\"color:rgb(15,17,17);\">Compact and portable design fits inside bag or purse easily</span></li></ul>', '', 'Belkin USB C Portable Power Bank (10000 mAh with 1 Port and 2 A Ports for up to 15W Charging iPhone, Android, AirPods, iPad, More) – Black', 'Belkin USB C Portable Power Bank (10000 mAh with 1 Port and 2 A Ports for up to 15W Charging iPhone, Android, AirPods, iPad, More) – Black', 'Belkin USB C Portable Power Bank (10000 mAh with 1 Port and 2 A Ports for up to 15W Charging iPhone, Android, AirPods, iPad, More) – Black', 'belkin,usbc,portablepowerbank,10000mah,black', 0, NULL, 'abc.com', 2, 510.5, '1', 100, 1, 1, 0, 'abc.com', 10.00, 1, 1, 0, 1, 10.00000, '5', 2, '5', 1, '/backend/files/8IcmkMiZvy1JrRScnMmN.jpg', 1, 1, NULL, NULL),
(16, NULL, 'Wipkviey T6 Drone,Drone with Camera 1080P for Beginners, WiFi FPV RC Quadcopter for Beginners, Gravity Sensor, Flip Mode, One Button Takeoff/Landing, One Button Return, Headless Mode, 2 Batteries', 'wipkviey-t6-drone-drone-with-camera-1080p-for-beginners-wifi-fpv-rc-quadcopter-for-beginners-gravity-sensor-flip-mode-one-button-takeoff-landing-one-button-return-headless-mode-2-batteries-16', '<ul><li><span style=\"color:rgb(15,17,17);\">【A great entry drone】: The T6 drone is suitable for beginners and children (from 14 years). The quadcopter is lightweight (120 grams), even drone beginners can get started in no time. The perfect gift idea for birthday and holiday.</span></li><li><span style=\"color:rgb(15,17,17);\">【Longer flight time】: This quad drone comes with two rechargeable batteries (SD card is NOT supported) for a total flight time of up to 30 minutes (15 minutes per battery). Sufficient endurance to add a new dimension to your bird\'s eye view.</span></li><li><span style=\"color:rgb(15,17,17);\">【Excellent stability】: T6 drone with camera does not use the foldable function and offers excellent flight stability. Better manoeuvrability makes it even easier to fly the drone as you want.</span></li><li><span style=\"color:rgb(15,17,17);\">【1080P HD FPV Camera】: The camera resolution of the T6 RC drone with camera is 1920*1080p. 90 degree adjustable camera + first person flight view and 2.4G real-time transmission function, along with the stable floating effect of our drone, gives you an even better photography experience.</span></li><li><span style=\"color:rgb(15,17,17);\">【Aesthetic design】: new pearl white housing with blue-green LED lights on the links of the drone for a cooler visual effect when flying at night.</span></li><li><span style=\"color:rgb(15,17,17);\">【Powerful】: The drone has a variety of playing options and can be easily controlled via the mobile app or remote control: headless mode, three-speed setting, 360 degree flip, automatic altitude, one-touch start/one-touch return. Make your flight experience less monotonous and more fun.</span></li><li><span style=\"color:rgb(15,17,17);\">【Please Note】: the first flight is recommended in an open and windless area. Please make sure that you do not fly too far away, otherwise you may lose control. Always calibrate the drone horizontally before starting and start the drone on a horizontal level, otherwise the drone will not be calibrated during the flight.</span></li><li><span style=\"color:rgb(15,17,17);\">【100% Customer Satisfaction】: Customer satisfaction is our goal, we offer you a 24-hour online customer service, if you have any unsatisfactory points or do not understand, please do not hesitate to contact us, our professional team will do its best to solve all your pre-sales and after-sales problems.</span></li></ul>', '', 'Wipkviey T6 Drone,Drone with Camera 1080P for Beginners, WiFi FPV RC Quadcopter for Beginners, Gravity Sensor, Flip Mode, One Button Takeoff/Landing, One Button Return, Headless Mode, 2 Batteries', 'Wipkviey T6 Drone,Drone with Camera 1080P for Beginners, WiFi FPV RC Quadcopter for Beginners, Gravity Sensor, Flip Mode, One Button Takeoff/Landing, One Button Return, Headless Mode, 2 Batteries', 'Wipkviey T6 Drone,Drone with Camera 1080P for Beginners, WiFi FPV RC Quadcopter for Beginners, Gravity Sensor, Flip Mode, One Button Takeoff/Landing, One Button Return, Headless Mode, 2 Batteries', 'Wipkviet6drone,withcamera.1080p,2battries,onebuttontakeoff/landing', 0, 'asd', 'abc.com', 2, 500, '1', 100, 1, 1, 0, 'abc.com', 10.00, 1, 1, 1, 1, 0.00000, '5', 0, '5', 1, '/backend/files/cKErUY88jkkZ5sT914XF.jpg', 1, 1, NULL, '2024-04-26 13:21:25'),
(17, NULL, 'TP-Link Archer AX10 Next-Gen Wi-Fi 6 Router, AX1500 Mbps Gigabit Dual Band Wireless, OneMesh Supported, Beamforming & MU-MIMO, Ideal for Gaming Xbox/PS5/Steam and 4K, Works with Alexa', 'tp-link-archer-ax10-next-gen-wi-fi-6-router-ax1500-mbps-gigabit-dual-band-wireless-onemesh-supported-beamforming-mu-mimo-ideal-for-gaming-xbox-ps5-steam-and-4k-works-with-alexa', '<ul><li><span style=\"color:rgb(15,17,17);\">Wi-Fi 6 Technology—Archer AX10 comes equipped with the latest wireless technology, Wi-Fi 6, for faster speeds, greater capacity, and reduced network congestion.</span></li><li><span style=\"color:rgb(15,17,17);\">Next-Gen 1.5 Gbps Speeds—Archer AX10 dual-band router reaches even faster speeds up to 1.5 Gbps (1201 Mbps on 5 GHz band and 300 Mbps on 2.4 GHz band).</span></li><li><span style=\"color:rgb(15,17,17);\">Connect Dozens of Devices—More simultaneous connections and reduced latency with OFDMA and MU-MIMO.</span></li><li><span style=\"color:rgb(15,17,17);\">Triple-Core CPU—Instant response to all your network activity with a 1.5 GHz triple-core CPU.</span></li><li><span style=\"color:rgb(15,17,17);\">Broader Coverage—4 Antennas and Beamforming technology focus signal towards individual clients for broader coverage.</span></li></ul>', '', 'TP-Link Archer AX10 Next-Gen Wi-Fi 6 Router, AX1500 Mbps Gigabit Dual Band Wireless, OneMesh Supported, Beamforming & MU-MIMO, Ideal for Gaming Xbox/PS5/Steam and 4K, Works with Alexa', 'TP-Link Archer AX10 Next-Gen Wi-Fi 6 Router, AX1500 Mbps Gigabit Dual Band Wireless, OneMesh Supported, Beamforming & MU-MIMO, Ideal for Gaming Xbox/PS5/Steam and 4K, Works with Alexa', 'TP-Link Archer AX10 Next-Gen Wi-Fi 6 Router, AX1500 Mbps Gigabit Dual Band Wireless, OneMesh Supported, Beamforming & MU-MIMO, Ideal for Gaming Xbox/PS5/Steam and 4K, Works with Alexa', 'Tplink,archerax10,nextgen,wifi6router,ac1500mbps', 0, NULL, 'abc.com', 2, 510.5, '1', 100, 1, 1, 0, 'abc.com', 10.00, 1, 1, 0, 1, 5.00000, '5', 2, '5', 1, '/backend/files/qzNRn0Bty8WpnAH0q4La.jpg', 1, 1, NULL, NULL),
(18, NULL, 'SanDisk 1TB Extreme Pro microSD UHS I Card for 4K Video on Smartphones, Action Cams & Drones 200MB/s Read, 140MB/s Write, SDSQXCD 1T00 GN6MA, Red/Black', 'sandisk-1tb-extreme-pro-microsd-uhs-i-card-for-4k-video-on-smartphones-action-cams-drones-200mb-s-read-140mb-s-write-sdsqxcd-1t00-gn6ma-red-black', '<ul><li><span style=\"color:rgb(15,17,17);\">With SanDisk&nbsp;QuickFlow&nbsp;Technology9, this card optimizes performance for timesaving media offloads with quick read speeds up to 200MB/s8&nbsp;(64GB - 1TB). Pair with the SanDisk&nbsp;Professional PRO-READER SD and microSD to achieve maximum speeds (sold separately).</span></li><li><span style=\"color:rgb(15,17,17);\">Capture fast-action photos or shoot 4K UHD video2&nbsp;with write speeds of up to 140MB/s.8&nbsp;The SanDisk Extreme&nbsp;PRO microSDXC&nbsp;UHS-I Card lets you shoot more and faster.</span></li><li><span style=\"color:rgb(15,17,17);\">Ideal for recording outdoor adventures, weekend trips, or sporting events without skipping frames. With up to 1TB1, the SanDisk Extreme&nbsp;PRO microSD&nbsp;UHS-I card lets you capture uninterrupted 4K UHD2&nbsp;and Full HD video with its UHS Speed Class 3 (U3) and Video Speed Class 30 (V30) ratings.4</span></li><li><span style=\"color:rgb(15,17,17);\">Get faster app performance for an outstanding smartphone experience thanks to the SanDisk Extreme&nbsp;PRO microSD card’s A25&nbsp;Specification.</span></li><li><span style=\"color:rgb(15,17,17);\">SanDisk Extreme&nbsp;PRO microSDHC and microSDXC UHS-I Cards are shockproof, temperature-proof, waterproof, and X-ray-proof,3&nbsp;so you can enjoy your adventures without worrying about the durability of your memory card.</span></li></ul>', '', 'SanDisk 1TB Extreme Pro microSD UHS I Card for 4K Video on Smartphones, Action Cams & Drones 200MB/s Read, 140MB/s Write, SDSQXCD 1T00 GN6MA, Red/Black', 'SanDisk 1TB Extreme Pro microSD UHS I Card for 4K Video on Smartphones, Action Cams & Drones 200MB/s Read, 140MB/s Write, SDSQXCD 1T00 GN6MA, Red/Black', 'SanDisk 1TB Extreme Pro microSD UHS I Card for 4K Video on Smartphones, Action Cams & Drones 200MB/s Read, 140MB/s Write, SDSQXCD 1T00 GN6MA, Red/Black', 'sandesk,1tb,sdcard,200mbpsread,140mbpswrite,redcolour,blackccolour', 0, NULL, 'abc.com', 2, 510.5, '1', 100, 1, 1, 0, 'abc.com', 10.00, 1, 1, 0, 1, 10.00000, '5', 2, '5', 1, '/backend/files/YHV5e9FCnM4KSS2BxOrf.jpg', 1, 1, NULL, NULL),
