(20, NULL, 'HP Deskjet 2720 All-in-One Printer, Wireless, Print, Copy, Scan - White [3XV18B]', 'hp-deskjet-2720-all-in-one-printer-wireless-print-copy-scan---white-3xv18b-', '<ul><li><span style=\"color:rgb(15,17,17);\">Easily handle tasks and get a lot from one device print, scan, and copy.</span></li><li><span style=\"color:rgb(15,17,17);\">Built-in wireless capabilities let you easily access, print, and share resources on a network.</span></li><li><span style=\"color:rgb(15,17,17);\">Use your smartphone to set up in a few easy steps, then connect and print from any device, using HP Smart – best-in-class mobile print app. Even use the HP Smart app to print, scan, and copy from anywhere.</span></li><li><span style=\"color:rgb(15,17,17);\">Get better range and faster, more reliable connections using dual-band Wi-Fi with self-reset.</span></li><li><span style=\"color:rgb(15,17,17);\">This printer is intended to work only with cartridges with original HP chips or circuitry and will block cartridges using non-HP chips or circuitry. Periodic firmware updates will maintain the effectiveness of these measures.</span></li></ul>', '', 'HP Deskjet 2720 All-in-One Printer, Wireless, Print, Copy, Scan - White [3XV18B]', 'HP Deskjet 2720 All-in-One Printer, Wireless, Print, Copy, Scan - White [3XV18B]', 'HP Deskjet 2720 All-in-One Printer, Wireless, Print, Copy, Scan - White [3XV18B]', 'HP,allinoneprinter,wireless,print,copy,scan', 0, NULL, 'abc.com', 2, 510.5, '1', 100, 1, 1, 0, 'abc.com', 10.00, 1, 1, 1, 1, 10.00000, '5', 2, '5', 1, '/backend/files/PViqouxmXcT4gq2pim85.jpg', 1, 1, NULL, NULL),
