(36, NULL, 'Spin Mop & Bucket Floor Cleaning System, Household Cleaning Supplies Stainless Steel Mop Bucket with Wringer on Wheels - 6 Mop Heads 155cm Handle, Mop with Bucket for Home Commercial Cleaning', 'spin-mop-bucket-floor-cleaning-system-household-cleaning-supplies-stainless-steel-mop-bucket-with-wringer-on-wheels---6-mop-heads-155cm-handle-mop-with-bucket-for-home-commercial-cleaning', '<ul><li><span style=\"color:rgb(15,17,17);\">【2X DRIER THAN FOOT PEDAL】- The spin mop bucket has stronger spin wringing performance than those work with pedal, so the mop head wrings drier, save efforts and is more durable. You don\'t have to spend as much energy to get the mop head to spin.</span></li><li><span style=\"color:rgb(15,17,17);\">【QUALITY MATERIAL】- Unlike others, basket, wringer, pallet and handle of our mop bucket with wringer are made of durable 304 stainless steel and PP. Upgraded handle allows the mop head to wing drier and make less noise. The telescoping handle adjusts up to 155cm, so you don’t have to bend down and suffer from back pain. Long handle allows you to clean windows and ceiling fans also.</span></li><li><span style=\"color:rgb(15,17,17);\">【INTIMATE DESIGN】 - This floor mop system has two wheels , one pull handle, one carry handle, easy mobility while cleaning, bringing extra comfort to the disabled and people who cannot manage heavy weight. There is also a drainage plug for draining water and a detergent dispenser for dirtier floor for ease of use.</span></li><li><span style=\"color:rgb(15,17,17);\">【EXTRA MICROFIBER MOP HEADS】 - Come with 6 microfiber spin mop refills head, so you don’t have to buy extra ones in 1-2 years. The mops have super thin microfiber with great absorbent ability, 360° spinning mop head for easy floor cleaning, the mop angles easily to reach underneath furniture, behind the toilet and into nooks and crannies. Deep-cleaning microfiber removes and absorbs tough dirt and grime.</span></li><li><span style=\"color:rgb(15,17,17);\">【Services】Household cleaning can be easily done with spin mop &amp; bucket cleaning system. If you find any problem with our the goods, please feel free to contact us, We promise to provide within 24 hours.</span></li></ul>', '', 'Spin Mop & Bucket Floor Cleaning System, Household Cleaning Supplies Stainless Steel Mop Bucket with Wringer on Wheels - 6 Mop Heads 155cm Handle, Mop with Bucket for Home Commercial Cleaning', 'Spin Mop & Bucket Floor Cleaning System, Household Cleaning Supplies Stainless Steel Mop Bucket with Wringer on Wheels - 6 Mop Heads 155cm Handle, Mop with Bucket for Home Commercial Cleaning', 'Spin Mop & Bucket Floor Cleaning System, Household Cleaning Supplies Stainless Steel Mop Bucket with Wringer on Wheels - 6 Mop Heads 155cm Handle, Mop with Bucket for Home Commercial Cleaning', 'Spinmopandbucketfloorcleaningsystem,householdcleaningsupplies,steelmop.cheapprice,2yearswaranty', 0, NULL, 'abc.com', 2, 510.5, '1 piece', 100, 1, 1, 0, 'abc.com', 10.00, 1, 1, 0, 1, 10.00000, '5', 2, '5', 1, '/backend/files/U5a0tkRgrsYEr4XEpxqH.jpg', 1, 1, NULL, NULL),
(37, NULL, 'ORLANE PARIS B21 Extraordinaire Box', 'orlane-paris-b21-extraordinaire-box', '<p style=\"margin-left:auto;\"><br>&nbsp;</p><figure class=\"image image_resized\" style=\"width:970px;\"><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/2fc0ebfd-e226-4016-9f56-3a00b4d019ae.__CR1,0,1633,1010_PT0_SX970_V1___.png\" alt=\"B21\"></figure><h3 style=\"margin-left:auto;\"><strong>B21 EXTRAORDINAIRE PROGRAM</strong></h3><p style=\"margin-left:auto;\">You are about to experience the B21 Extraordinaire skincare range...</p><p style=\"margin-left:auto;\">The skincare products designed to restore the appearance of youth, promising a refreshed, healthy complexion. The Exclusive Youth Reset Complex targets all aging factors that cause problems in the skin and restores the energy and mechanisms of its youth.</p><p style=\"margin-left:auto;\">A global action on all signs of aging. Wrinkles visibly fade, expression lines appear diminished, skin becomes radiant, dark spots fade, skin is firmed and hydrated within a voluptuously addictive texture. This revolutionary formula acts on the source of aging deep within the cell.</p><p style=\"margin-left:auto;\">For the first time, an exclusive complex resets cells. It targets all the factors that cause problems within the cell and sets the clock back.</p><p style=\"margin-left:auto;\">Cells regain all their energy and function as they did in youth; the skin can benefit fully from the essential elements provided to construct its collagen and its body.</p><p style=\"margin-left:auto;\">The action of 21 essential amino acids extracted from pale iris stem cells, obtained using biotechnology techniques, is optimized.</p><p style=\"margin-left:auto;\">They are the building blocks of every protein, helping to build younger, denser skin.</p><p style=\"margin-left:auto;\">This universal product was designed for you. Whatever your age, this treatment will provide you with fresh, youthful looking skin. Because of its unique texture, it can be applied by itself.</p><p style=\"margin-left:auto;\">Because it resets the clock for your cells, B21 Extraordinaire, when applied together with a serum or a cream, boosts their efficiency</p><p style=\"margin-left:auto;\">&nbsp;</p><ul><li><span style=\"color:rgb(15,17,17);\">The skin is glowing and even more beautiful 97%.</span></li><li><span style=\"color:rgb(15,17,17);\">The skin is firmer, wrinkles are reduced 97%.</span></li><li><span style=\"color:rgb(15,17,17);\">The skin is soft and smooth 100%.</span></li><li><span style=\"color:rgb(15,17,17);\">The skin is hydrated, comfortable 97%.</span></li></ul><p style=\"margin-left:auto;\">&nbsp;</p><figure class=\"table\" style=\"float:left;width:969px;\"><table style=\"background-color:rgb(255, 255, 255);\"><tbody><tr><th style=\"height:234px;padding:0px 30px 0px 0px;text-align:center;width:220px;\"><figure class=\"image image_resized\" style=\"width:220px;\"><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/eb0afbde-eb1d-47c4-96c0-569d39349e44.__CR0,0,300,300_PT0_SX220_V1___.png\" alt=\"1\"></figure></th><th style=\"height:234px;padding:0px 30px 0px 0px;text-align:center;width:220px;\"><figure class=\"image image_resized\" style=\"width:220px;\"><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/1564b3eb-4e50-46a8-aa36-f74c2662b8d7.__CR0,0,300,300_PT0_SX220_V1___.png\" alt=\"2\"></figure></th><th style=\"height:234px;padding:0px 30px 0px 0px;text-align:center;width:220px;\"><figure class=\"image image_resized\" style=\"width:220px;\"><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/3a91efb5-d0cb-420c-8cad-efc01a8ded59.__CR0,0,300,300_PT0_SX220_V1___.png\" alt=\"3\"></figure></th><th style=\"height:234px;padding:0px;text-align:center;width:220px;\"><figure class=\"image image_resized\" style=\"width:220px;\"><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/58352d1e-391c-4534-ab55-9ed4485bc727.__CR0,0,300,300_PT0_SX220_V1___.png\" alt=\"4\"></figure></th></tr><tr><th style=\"height:136.328px;padding:3px 3px 0px 0px;vertical-align:top;\"><h4 style=\"margin-left:0px;\">Skin Type</h4><p style=\"margin-left:0px;\">All skin types</p></th><th style=\"height:136.328px;padding:3px 3px 0px;vertical-align:top;\"><h4 style=\"margin-left:0px;\">Skin Concerns</h4><p style=\"margin-left:0px;\">&nbsp;</p><ul><li><span style=\"color:rgb(15,17,17);\">Wrinkles</span></li><li><span style=\"color:rgb(15,17,17);\">Puffiness</span></li><li><span style=\"color:rgb(15,17,17);\">Dark circles,</span></li><li><span style=\"color:rgb(15,17,17);\">Texture of eye are uneven</span></li></ul><p style=\"margin-left:0px;\">&nbsp;</p></th><th style=\"height:136.328px;padding:3px 3px 0px;vertical-align:top;\"><h4 style=\"margin-left:0px;\">Key Ingredients</h4><p style=\"margin-left:0px;\">Exclusive Youth Rest Complex, 21 amino acids extracted from the Pale Blue Iris Stem cells</p></th><th style=\"height:136.328px;padding:3px 0px 0px 3px;vertical-align:top;\"><h4 style=\"margin-left:0px;\">Smart Ingredients</h4><p style=\"margin-left:0px;\">An extraordinary synergy of active ingredients for a powerful regenerative action at all levels of the epidermis</p></th></tr></tbody></table></figure><figure class=\"image image_resized\" style=\"width:969px;\"><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/18ffbece-fb0b-45e2-8392-332f75b92ea8.__CR149,0,3543,4724_PT0_SX300_V1___.jpg\" alt=\"b21\"></figure><p style=\"margin-left:auto;\"><br>&nbsp;</p><p style=\"margin-left:auto;\">&nbsp;</p><figure class=\"image image_resized\" style=\"width:969px;\"><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/02d85667-2299-4d23-be69-9459f522f806.__CR1333,855,1015,507_PT0_SX350_V1___.jpg\" alt=\"f\"></figure><p style=\"margin-left:auto;\"><strong>How to use/Directions</strong></p><p style=\"margin-left:auto;\">&nbsp;</p><p style=\"margin-left:auto;\">B21 Lotion</p><p style=\"margin-left:auto;\">Use morning and night, after cleansing. Ideal for use after any of the Orlane cleansers and before B21 Extraordinaire.</p><p style=\"margin-left:auto;\">B21 Extraodinaire</p><p style=\"margin-left:auto;\">Use morning and night, after cleansing and toning. Apply alone, or in combination with a serum and/or cream.</p><p style=\"margin-left:auto;\">B21 Eye</p><p style=\"margin-left:auto;\">Apply morning and evening to the eye contour area alone or under usual eye contour product</p><h3 style=\"margin-left:auto;\"><strong>B21 Extraordinaire Gift Set</strong></h3><p style=\"margin-left:auto;\">Complete luxury and most advanced technology, our B21 Extraordinaire Set is the full line available as the perfect gift.</p><p style=\"margin-left:auto;\">The set contains:</p><ul><li><span style=\"color:rgb(15,17,17);\">B21 Extraordinaire Youth Reset 1.0 oz</span></li><li><span style=\"color:rgb(15,17,17);\">B21 Lotion Extraordinaire 4.3 oz</span></li><li><span style=\"color:rgb(15,17,17);\">B21 Extraordinaire Youth Eye 0.5 oz</span></li></ul><figure class=\"image image_resized\" style=\"width:969px;\"><img src=\"https://m.media-amazon.com/images/S/aplus-media/vc/cacb9add-e16c-4202-a23c-14d37ff6d88e.__CR0,2,590,590_PT0_SX300_V1___.jpg\" alt=\"o\"></figure><h3 style=\"margin-left:auto;\"><strong>ORLANE PARIS</strong></h3><p style=\"margin-left:auto;\">The Orlane Laboratories, pioneers in the field of anti-aging skincare, were the first to base their expertise on the amazing potential of energy to reeducate the skin and help it regain its original abilities.</p><p style=\"margin-left:auto;\">Enriched with the B21 Bio-Energic Anti-Aging Complex, these products are on the cutting edge of research and meet every need of women with the absolute highest expectations for their beauty.</p><p style=\"margin-left:auto;\">Combining its mastery of anti-aging techniques with its unique esthetic experience, Orlane is present in institutes worldwide to offer exceptional treatments whose innovation and effectiveness are matched only by emotion, luxury and sensuality.</p>', '', 'ORLANE PARIS B21 Extraordinaire Box', 'ORLANE PARIS B21 Extraordinaire Box', 'ORLANE PARIS B21 Extraordinaire Box', 'ORLANE, PARIS, B21, Extraordinaire, Box', 0, NULL, 'https://www.amazon.com/ORLANE-PARIS-B21-Extraordinaire-Box/dp/B06XDLNH9C', 2, 510.5, 'pc', 1658, 1, 1, 0, 'https://www.amazon.com/Roche-Posay-Toleriane-Double-Repair-Moisturizer/dp/B01N9SPQHQ', 20.00, 1, 1, 0, 0, 0.00000, '0', 1, '0', 1, '/backend/files/5AO6yjUw9fmu6FhSp2v2.jpg', 1, 1, NULL, NULL),
