(83, NULL, 'NEEWER 14.2”/36cm Flexible Holding Arm, Camera Mount Stand Overhead Extension Arm with 360° Swivel Ball Head and Adjustable Clamp for DSLR & Mirrorless Camera, Phone, LED Video Light, Webcam, CR221A', 'neewer-14-2-36cm-flexible-holding-arm-camera-mount-stand-overhead-extension-arm-with-360-swivel-ball-head-and-adjustable-clamp-for-dslr-mirrorless-camera-phone-led-video-light-webcam-cr221a', '<ul><li><span style=\"color:rgb(15,17,17);\">【Auxiliary Holding Arm】 Connected to your desk mounted stand for overhead lighting, microphone holding, flat lay photography, and video conferencing, this 14.2” (36cm) horizontal boom arm from NEEWER can do it all. Get the arm and give your filming setup a new mounting possibility for extra accessories</span></li><li><span style=\"color:rgb(15,17,17);\">【All Angle Adjustment】 A 360° rotatable ball head with 90° tilt movement allows you to direct your device at any angle. The 1/4” screw is compatible with most DSLR &amp; mirrorless cameras, LED video lights, webcams, phone holders, microphone holder, and more</span></li><li><span style=\"color:rgb(15,17,17);\">【Secure Easy Clamping】 Use the adjustable, rubber padded oval clamp to fasten the boom arm to a center column, pipe, tube, or rod 0.9”/22m to 1.1”/28mm in diameter with reliable security. (Note: The arm is not recommended to clamp on the top section of your stand)</span></li><li><span style=\"color:rgb(15,17,17);\">【Robust Construction】 Engineered with black anodized aluminum alloy, the boom arm is lightweight yet solid, and able to support a maximum load of 2.2lb (1kg)</span></li><li><span style=\"color:rgb(15,17,17);\">【Versatile Application】 An ideal mounting solution for overhead lighting, microphone holding, flat lay photography, product photography, vlogging, video conferencing, live streaming, remote working, and online teaching</span></li></ul>', '', 'NEEWER 14.2”/36cm Flexible Holding Arm, Camera Mount Stand Overhead Extension Arm with 360° Swivel Ball Head and Adjustable Clamp for DSLR & Mirrorless Camera, Phone, LED Video Light, Webcam, CR221A', 'NEEWER 14.2”/36cm Flexible Holding Arm, Camera Mount Stand Overhead Extension Arm with 360° Swivel Ball Head and Adjustable Clamp for DSLR & Mirrorless Camera, Phone, LED Video Light, Webcam, CR221A', 'NEEWER 14.2”/36cm Flexible Holding Arm, Camera Mount Stand Overhead Extension Arm with 360° Swivel Ball Head and Adjustable Clamp for DSLR & Mirrorless Camera, Phone, LED Video Light, Webcam, CR221A', 'NEEWER, 14.2”/36cm, Flexible, Holding, Arm,, Camera, Mount, Stand, Overhead, Extension, Arm, with, 360°, Swivel, Ball, Head, and, Adjustable, Clamp, for, DSLR, &, Mirrorless, Camera,, Phone,, LED, Video, Light,, Webcam,, CR221A', 0, NULL, 'abc.com', 2, 510.5, 'pc', 100, 1, 1, 0, 'abc.com', 10.00, 1, 1, 0, 1, 10.00000, '5', 2, '5', 1, '/backend/files/Dj3JqqQ1kihECkfIkoB8.jpg', 1, 1, NULL, NULL),
