(85, NULL, '9x12-inch Black Frame - Made to Display Pictures 6x8-inches with Matte or 9x12-inches Without Matte - Camera Photography Frame', '9x12-inch-black-frame---made-to-display-pictures-6x8-inches-with-matte-or-9x12-inches-without-matte---camera-photography-frame', '<ul><li><span style=\"color:rgb(15,17,17);\">Design: Black 9x12 inch picture frame, perfect for your cherished memories; frame includes white beveled mat and hanging hardware for hassle-free display in both horizontal and vertical formats to hang flat against the wall</span></li><li><span style=\"color:rgb(15,17,17);\">Material: Wood frame with lead free tempered shatter-resistant glass that gives a clear view of your photo</span></li><li><span style=\"color:rgb(15,17,17);\">Quality: Durable, gallery-style frame; the frame\'s front has clear glass and a sturdy backboard to keep your photo in place</span></li><li><span style=\"color:rgb(15,17,17);\">Use and Display: Perfect for 6x8 inch photos with mat or 9x12 without mat; the actual mat opening is 5.5x7.5 inches</span></li><li><span style=\"color:rgb(15,17,17);\">Protective Packaging: Americanflat developed exclusive proprietary packaging that helps ensure safe delivery of fragile items; order with confidence, click and add to cart today</span></li></ul>', '', '9x12-inch Black Frame - Made to Display Pictures 6x8-inches with Matte or 9x12-inches Without Matte - Camera Photography Frame', '9x12-inch Black Frame - Made to Display Pictures 6x8-inches with Matte or 9x12-inches Without Matte - Camera Photography Frame', '9x12-inch Black Frame - Made to Display Pictures 6x8-inches with Matte or 9x12-inches Without Matte - Camera Photography Frame', '9x12-inch, Black, Frame, -, Made, to, Display, Pictures, 6x8-inches, with, Matte, or, 9x12-inches, Without, Matte, -, Camera, Photography, Frame', 0, NULL, 'abc.ccom', 2, 510.5, 'pc', 100, 1, 1, 0, 'abc.com', 10.00, 1, 1, 0, 1, 10.00000, '5', 1, '5', 1, '/backend/files/4K1F4IHD6YywBWKfRWZG.jpg', 1, 1, NULL, NU