(86, NULL, 'Photography Demystified - For Kids!: A Kid\'s Guide and Parents Resource to Fun and Learning Photography Together Paperback – 18', 'photography-demystified---for-kids-a-kid-s-guide-and-parents-resource-to-fun-and-learning-photography-together-paperback-18', '<p style=\"margin-left:0px;\">\"David McKay has hit another home run! Photography Demystified for Kids is destined to become a classic in the photography world! He has dozens of fun projects for parents (and grandparents) to enjoy with the younger generation. My favorite one is finding the letters of the alphabet in nature. I especially love that he included using smartphones as a tool because that is what will initially appeal to children. I think it is a nice bridge to them wanting to learn on a camera. What a fun way to spend time with your kids and get them outside!\"</p><p style=\"margin-left:0px;\">\"What a clever and powerful product. I highly recommend buying it and sharing it with as many kids as you can. This is a well-written, timely, and wonderful gift you will give to both yourself and others. The book takes a topic that can sometimes be overpowering for even adults and teaches in a way that guides and entices the young reader. The writing is clear and the examples very well thought out, but I sense the greatest strength of the book comes in how well it communicates with children. Here\'s how I know: I read the book and then decided to put it into practice testing it out with the neighborhood children.<br><br>The impact was immediate as the kids read, asked questions, played, experimented and compared their own work. Soon they were teaching each other their new \"tricks.\" Parents soon came over to see what was happening, and what was intended to be a brief experiment, I suspect may well become a neighborhood photography circle of sorts -- one where parents, siblings, and friends are all invited\".</p><p style=\"margin-left:0px;\">\"I have loved every one of David McKay\'s books and this one is no different. Cover to cover this book will either assist you in introducing photography to your kids or help bolster what they may already know. It\'s a great book to work through with them, or depending on their age, they can easily work through it on their own. Such a great addition to his other photography books!\"</p><p style=\"margin-left:0px;\">&nbsp;</p><p style=\"margin-left:0px;\">\"As a homeschool parent, I am always looking for resources that I can share with my kids that are technically strong, but written with kids in mind. This book does just that. Whether my child picks up the book and investigates a concept or I use it as a resource for teaching, it clearly defines photography concepts and encourages experimentation. I am happy to expose my kids to the world of photography!\"</p><p style=\"margin-left:0px;\">&nbsp;</p><p style=\"margin-left:0px;\">\"David McKay once again hits a home run. Photography Demystified for Kids does an amazing job of bringing the passion and know how of photography to kids. It has allowed me to get my son more involved in understanding what I\'m thinking or why I\'m doing something a certain way. My son loves to take photos with my old DSLR and my iPhone. We love to compare our shots and see what we captured.\"</p><p style=\"margin-left:0px;\">&nbsp;</p><p style=\"margin-left:0px;\">\"This book is awesome! It\'s a great combination of tips of how to have fun with kids using photography as well as great photopgraphy educational lessons. I particularly like the tips for \"projects\" we can do together with our kids whilst exploring &amp; having fun. It is also inspirational for the kids - a great way to inspire child to see the beauty in all that surround us.\"</p>', '', 'Photography Demystified - For Kids!: A Kid\'s Guide and Parents Resource to Fun and Learning Photography Together Paperback – 18', 'Photography Demystified - For Kids!: A Kid\'s Guide and Parents Resource to Fun and Learning Photography Together Paperback – 18Photography Demystified - For Kids!: A Kid\'s Guide and Parents Resource to Fun and Learning Photography Together Paperback – 18', 'Photography Demystified - For Kids!: A Kid\'s Guide and Parents Resource to Fun and Learning Photography Together Paperback – 18', 'Photography, Demystified, -, For, Kids!:, A, Kid\'s, Guide, and, Parents, Resource, to, Fun, and, Learning, Photography, Together, Paperback, –, 18', 0, NULL, 'abc.com', 2, 510.5, 'pc', 100, 1, 1, 0, 'abc.com', 10.00, 1, 1, 0, 1, 10.00000, '5', 2, '5', 1, '/backend/files/SvZP4qcffCgvKDj2y6cF.jpg', 1, 1, NULL, NULL),
(87, NULL, 'Cyber Clean Complete Camera Cleaner - Yellow', 'cyber-clean-complete-camera-cleaner---yellow', '<ul><li><span style=\"color:rgb(15,17,17);\">Cyber Clean with its unique cleaning and disinfecting effect</span></li><li><span style=\"color:rgb(15,17,17);\">Compact size, fits in all camera cases, ideal for travelling</span></li><li><span style=\"color:rgb(15,17,17);\">Highly professional and attractive design</span></li><li><span style=\"color:rgb(15,17,17);\">UNIQUE All-in-one Product - No other or similar item on the market</span></li><li><span style=\"color:rgb(15,17,17);\">1 x Cyber Clean Camera Kit</span></li></ul>', '', 'Cyber Clean Complete Camera Cleaner - Yellow', 'Cyber Clean Complete Camera Cleaner - Yellow', 'Cyber Clean Complete Camera Cleaner - Yellow', 'Cyber, Clean, Complete, Camera, Cleaner, -, Yellow', 0, NULL, 'abc.com', 2, 510.5, 'pc', 100, 1, 1, 0, 'abc.com', 10.00, 1, 1, 1, 0, 10.00000, '5', 2, '5', 1, '/backend/files/A1z3sDTNYCLWzd5RrTEM.jpg', 1, 1, NULL, NULL),
(88, NULL, 'Environmental Control', 'environmental-control', '<p>Passive solutions including the applications of natural ventilations, designing the three building components, the roof ceiling, the wall and the floor by applying sustainable and passive solutions. Also, local building materials, roof and wall insulation. Designing the indoor environment and designing the outdoor environment. In addition, the second part of the book will discuss the technical solutions in applying the HVAC system, safety procedures, energy efficiency, and sustainability in buildings including the global assessment methods like LEED, BREEAM, GSAS, ESTIDAMA and Green Star Rating System.The Third part of the book includes student scientific researches during this course that I teach for 15 years, those papers were published in international journals.</p><p>&nbsp;</p><p><br>&nbsp;</p>', '', 'Environmental Control', 'Environmental Control', 'Environmental Control', 'Environmental, Control', 0, NULL, 'abc.com', 2, 510.5, 'pc', 100, 1, 1, 0, 'abc.com', 10.00, 1, 1, 0, 1, 10.00000, '5', 2, '5', 1, '/backend/files/RQbfBLtGTFaIRgbW8You.jpg', 1, 1, NULL, NULL),
(89, NULL, 'Basic Engineering Circuit Analysis Loose Leaf', 'basic-engineering-circuit-analysis-loose-leaf', '<p style=\"margin-left:0px;\">J. David Irwin is an American engineering educator and author of popular textbooks in electrical engineering and related areas. He is the Earle C. Williams Eminent Scholar and former Electrical and Computer Engineering Department Head at Auburn University.</p><p style=\"margin-left:0px;\">R. Mark Nelms is the author of Basic Engineering Circuit Analysis, 12th Edition, published by Wiley.</p><p>&nbsp;</p><p><br>&nbsp;</p>', '', 'Basic Engineering Circuit Analysis Loose Leaf', 'Basic Engineering Circuit Analysis Loose Leaf', 'Basic Engineering Circuit Analysis Loose Leaf', 'Basic, Engineering, Circuit, Analysis, Loose, Leaf', 0, NULL, 'abc.com', 2, 510.5, 'pc', 100, 1, 1, 0, 'abc.com', 10.00, 1, 1, 0, 1, 10.00000, '5', 2, '5', 1, '/backend/files/zkyfNd8SyP9E7NvLkjOW.jpg', 1, 1, NULL, NULL),
