(118, NULL, 'Re-flection Voyager Carry-on Suitcase, Lightweight Vertical Series Travel Soft Luggage Trolley, 4 Spinner Wheels', 're-flection-voyager-carry-on-suitcase-lightweight-vertical-series-travel-soft-luggage-trolley-4-spinner-wheels', '<p>Our luggage set is made of high-quality soft Nylon material for the soft-shell which makes our luggage set more sturdy, lightweight and impact-resistant. Its lightweight construction helps you to maintain airline weight restrictions. The perfect luggage solution for all individuals. Its durable yet lightweight material provides long-lasting usage and safety.Shaped in such a way that you can place all your travel belongings in it so easily and all your stuff will be well arranged. Excellent choice for Long-distance business trips and tours.High performance ball bearing wheels and lightweight yet sturdy power scope Lite handle reduce wobble and ensure a smooth, easy roll. Expands up to 2 inches to maximize packing capacity with tapered shape to prevent tipping; Features, 2 exterior compartments, full length interior lid pocket, and adjustable hold down straps for packing convenience and flexibility.With 3 levels of the adjustable handle and it is super easy to adjust the size you need. Whether you\'re a frequent traveller or just planning a getaway, this trolley won\'t let you down.Our Hardcase Trolley Luggage Bag features 4 multi-directional 360° spinner wheels which are perfect for all your globetrotting endeavours.</p>', '', 'Re-flection Voyager Carry-on Suitcase, Lightweight Vertical Series Travel Soft Luggage Trolley, 4 Spinner Wheels', 'Re-flection Voyager Carry-on Suitcase, Lightweight Vertical Series Travel Soft Luggage Trolley, 4 Spinner Wheels', 'Re-flection Voyager Carry-on Suitcase, Lightweight Vertical Series Travel Soft Luggage Trolley, 4 Spinner Wheels', 'Re-flection, Voyager, Carry-on, Suitcase,, Lightweight, Vertical, Series, Travel, Soft, Luggage, Trolley,, 4, Spinner, Wheels', 0, NULL, 'abc.com', 2, 510.5, 'pc', 100, 1, 1, 0, 'abc.com', 10.00, 1, 1, 0, 1, 10.00000, '5', 2, '5', 1, '/backend/files/yzoNso2UJA3FEHadZTnJ.jpg', 1, 1, NULL, NULL),
