(120, NULL, 'OMIRA Military Tactical Backpack, 45L Large Army 3 Day Assault Pack, Molle Backpack, Emergency Pack, Travel Mountaineering Bag, Hiking Backpacks Ideal for Camping, Hunting, Hiking, Outdoor Adventure', 'omira-military-tactical-backpack-45l-large-army-3-day-assault-pack-molle-backpack-emergency-pack-travel-mountaineering-bag-hiking-backpacks-ideal-for-camping-hunting-hiking-outdoor-adventure', '<p>The Space You Need --- This tactical backpack measures approximately: 30*28*50cm/11.81*11.02*19.68 inches and 45L capacity, this backpack has enough space for all your essential gear. The spacious multi-level internal storage compartment can hold a lot of outdoor gear, and also meet your daily travel needs. Suitable for fitness, outdoor travel, hiking and other outdoor activities. Waterproof &amp; Scratch-Resistant Design --- The backpack is made of 600*600D encrypted oxford cloth, the tactical assault backpack is reinforced and double stitched at all pressure points. Durable and durable, our special coating makes our training backpacks both water-resistant and scratch-resistant. Molle Modular Design --- The Molle backpack has a webbing system on the front and sides, designed to be combined with other equipment, you can attach extra bags or gear as a tactical backpack; such as water bottle bag, intercom bag, first aid bag, flashlight bag, sundry bag As well as sleeping bags and mats. Multiple Compartments --- Designed with 5 compartments for storing different things: two front pockets for small items, two large compartments with built-in zipper pockets and mesh for large and important supplies Bag, dedicated laptop/device compartment, an Army backpack that opens flat to 180 degrees for easy packing/unpacking, and a hidden rear pocket for frequently used items. Comfort And Functionality --- This sports gym backpack features double stitching, padded shoulder straps and a back area with mesh backing for comfort, ventilation and strength during travel. High-quality 