(129, 4, 'Lauwell 4 Pcs Christmas Dog Pet Costume Include 2 Christmas Tree Hat Small Dog Headgear and 2 Adjustable Collars Bib Santa Elf Cat Bib for Xmas Dog Cat Outfit Clothing Party Accessory', 'lauwell-4-pcs-christmas-dog-pet-costume-include-2-christmas-tree-hat-small-dog-headgear-and-2-adjustable-collars-bib-santa-elf-cat-bib-for-xmas-dog-cat-outfit-clothing-party-accessory', '<ul><li><span style=\"color:rgb(15,17,17);\">What Will Get: this Christmas dog costume set contains 1 green elk dog bib, 1 red Santa Claus dog bib, 2 pieces of dog tree hats in green and red, which are cool and cute Christmas gifts for your puppies and cats</span></li><li><span style=\"color:rgb(15,17,17);\">Reassuring Quality: the pet santa hat is made of short plush material, and the dog bib is made of quality polyester and cotton fabric, soft and comfortable, suitable for most small pets to wear</span></li><li><span style=\"color:rgb(15,17,17);\">Classic Christmas Design: this dog Christmas costume mainly adopt red and green color, combined with classic elk and Santa Claus patterns, which are full of festive color and atmosphere, ideal for Christmas holiday, party, and outdoor activities</span></li><li><span style=\"color:rgb(15,17,17);\">Wide Application: this Christmas clothing set can make your pets more lovely, which suits for Christmas party, daily wearing, photo shoots, cosplay parties, performance dressing and Halloween parties</span></li><li><span style=\"color:rgb(15,17,17);\">Christmas Gifts: these Christmas dog clothes are suitable to give your puppy or friend\'s pet as a lovely Christmas gift, making pets stand out at Christmas parties, they will like to receive the gift.Care Instructions: Hand Wash Only</span></li></ul>', '', 'Lauwell 4 Pcs Christmas Dog Pet Costume Include 2 Christmas Tree Hat Small Dog Headgear and 2 Adjustable Collars Bib Santa Elf Cat Bib for Xmas Dog Cat Outfit Clothing Party Accessory', 'Lauwell 4 Pcs Christmas Dog Pet Costume Include 2 Christmas Tree Hat Small Dog Headgear and 2 Adjustable Collars Bib Santa Elf Cat Bib for Xmas Dog Cat Outfit Clothing Party Accessory', 'Lauwell 4 Pcs Christmas Dog Pet Costume Include 2 Christmas Tree Hat Small Dog Headgear and 2 Adjustable Collars Bib Santa Elf Cat Bib for Xmas Dog Cat Outfit Clothing Party Accessory', 'Lauwell, 4, Pcs, Christmas, Dog, Pet, Costume, Include, 2, Christmas, Tree, Hat, Small, Dog, Headgear, and, 2, Adjustable, Collars, Bib, Santa, Elf, Cat, Bib, for, Xmas, Dog, Cat, Outfit, Clothing, Party, Accessory', 0, NULL, 'abc.com', 2, 510.5, '4 pcs', 10, 1, 1, 0, 'abc.com', 10.00, 1, 1, 0, 1, 10.00000, '5', 2, '5', 1, '/backend/files/z4KvM25i2bi1aY05T2Ak.jpg', 1, 1, NULL, NULL),
(130, 4, 'JOY FOR ALL - Orange Tabby Cat - Interactive Companion Pets - Realistic & Lifelike', 'joy-for-all---orange-tabby-cat---interactive-companion-pets---realistic-lifelike', '<ul><li><span style=\"color:rgb(15,17,17);\">Cat-like movements &amp; sounds: our revolutionary vibrapurr technology gives the cat an authentic purr that sounds and feels just like real purring. A real cat would, our companion pet cat is able to open and close its eyes, lift its Paw, open its mouth and move its head and body. The companion pet cat also has synthetic, soft, brushable fur inspired by real feline breeds.</span></li><li><span style=\"color:rgb(15,17,17);\">Built in sensors: using the built in sensors, our companion pet cat responds to motion and touch such as Petting and hugging, much like the real Cats you know and love, but doesn\'t require any special care or feeding.</span></li><li><span style=\"color:rgb(15,17,17);\">A rich experience: Designed to bring comfort, companionship and fun to Elder loved ones. The ease of care and convenience paired with our state of the art technology makes for the best possible interactive experience for older adults living in senior communities or aging at home, and their caregivers or simply just a person that could use some extra company.</span></li><li><span style=\"color:rgb(15,17,17);\">Award winning: Joy For All companion pets won the caregiver friendly award from today\'s caregiver two years in 2016 and 2017. This product has appeared in the new York times, people magazine and the Baltimore sun. It has also been seen on CBS and the doctors and heard on BBC radio.</span></li><li><span style=\"color:rgb(15,17,17);\">Ageless innovation: ageless innovation is a global company devoted to developing fun and engaging products for older adults. Beginning with the award-winning line of Joy For All companion pets, originally designed and launched by Hasbro, ageless innovation is focused on creating products that promote fun, joy and play while creating meaningful connections for aging loved ones, their families, and caregivers.</span></li></ul>', '', 'JOY FOR ALL - Orange Tabby Cat - Interactive Companion Pets - Realistic & Lifelike', 'JOY FOR ALL - Orange Tabby Cat - Interactive Companion Pets - Realistic & Lifelike', 'JOY FOR ALL - Orange Tabby Cat - Interactive Companion Pets - Realistic & Lifelike', 'JOY, FOR, ALL, -, Orange, Tabby, Cat, -, Interactive, Companion, Pets, -, Realistic, &, Lifelike', 0, NULL, 'abc.com', 2, 510.5, 'pc', 10, 1, 1, 0, 'abc.com', 10.00, 1, 1, 0, 1, 10.00000, '5', 2, '5', 1, '/backend/files/j8ed3krpUgfd6CLVmEI4.jpg', 1, 1, NULL, NULL),
(132, 4, 'Dragro Sheep Clippers 600W, Professional Animal Shearing Machine, Farm Livestock Grooming Kit, Heavy Duty Electric Clippers for Thick Coat Animals (Sheep Clippers-600W)', 'dragro-sheep-clippers-600w-professional-animal-shearing-machine-farm-livestock-grooming-kit-heavy-duty-electric-clippers-for-thick-coat-animals-sheep-clippers-600w-', '<ul><li><span style=\"color:rgb(15,17,17);\">🐏【Powerful Motor】Dragro electric Sheep shears has a power of 600watts and provides up to 2400 strokes/min to improve efficiency, which makes your job of shearing sheep, goats, alpaca, llamas and angora rabbits to become more easily!</span></li><li><span style=\"color:rgb(15,17,17);\">🐏【6-SPEED ADJUSTABLE】Low speed (1-3) offers precision performance to clip sensitive areas while high speed (4-6) delivers maximum power for faster trims and full body shave down. Whether you are a beginner or professional, the 6 speeds control help you finish the task quickly and easily.</span></li><li><span style=\"color:rgb(15,17,17);\">🐑【PROFESSIONAL SHEARS】This professional electric sheep clipper has a blade with high hardness and high heat resistance. the blade tension rotatable button for easy and quick shearing. long lasting use not harm the animal. suitable for sheep, goats, llamas, alpacas. We do not recommend using it on cats and puppies.</span></li><li><span style=\"color:rgb(15,17,17);\">🐑【SAVE TIME】 Can cut 6-10 sheep in one hour, suitable for family farming or pasture farming. Labor-saving, the grip structure of the scissors is humanized, and the long-term shearing of the hand will not be fatigued.</span></li><li><span style=\"color:rgb(15,17,17);\">🐑【NOTE】 -When using electric wool shears, remember to lubricate the blades. Remember that the livestock clippers cannot run at idle to prevent the blade from overheating . Please use the cooling spray every few minutes, take short breaks during shearing, clean the blade in time . Please read the operating instructions carefully before use.<