ger for Men and Women (Green and Brown)', 'TIDEWE, Bootfoot, Chest, Wader,, 2-Ply, Nylon/PVC, Waterproof, Fishing, &, Hunting, Waders, with, Boot, Hanger, for, Men, and, Women, (Green, and, Brown)', 0, NULL, 'abc.com', 2, 510.5, 'pc', 100, 1, 1, 0, 'abc.com', 10.00, 1, 1, 0, 1, 10.00000, '5', 2, '5', 1, '/backend/files/Tao44KEYgCxtP7U7fhQr.jpg', 1, 1, NULL, NULL),
