(188, 4, 'VIJIM LS08 Flexible Overhead Camera Mount Desk Stand, Webcam Stand Microphone Boom Arm Tabletop Photography Videography Live Stream Table clamp Mount', 'vijim-ls08-flexible-overhead-camera-mount-desk-stand-webcam-stand-microphone-boom-arm-tabletop-photography-videography-live-stream-table-clamp-mount', '<ul><li><span style=\"color:rgb(15,17,17);\">🏆【3-Section Detachable Pole】Each pole is connect and disconnect via 1/4\" ball head. Each pole can be freely rotated and adjusted.</span></li><li><span style=\"color:rgb(15,17,17);\">🏆【2 Microphone Screw Adapters】 Come with 1/4\" to 5/8\" and 1/4\" to 3/8\" Screw Adapter, suitable for any kinds of microphones.</span></li><li><span style=\"color:rgb(15,17,17);\">🏆【Standard 1/4 thread】1KG Load-bearing in the horizontal state. The ball head has a universal 1/4-20 screw head adapter, compatible with dslr, slr, ring light, led video lighting, lightweight cam, webcam. Perfect for phone photography, videography, art, cooking video recording, video shooting, vlogging</span></li><li><span style=\"color:rgb(15,17,17);\">🏆【Stable Aluminum Padded Desk Clamp】The Aluminum tabletop light mount with padded desk clamp, it is expandable up to 5 Centimetre/2 inch, compatible with most desk in the market and provides maximum stability.</span></li><li><span style=\"color:rgb(15,17,17);\">🏆【Aluminum Alloy Material】The arm part is made of aviation aluminum alloy, processed by high-precision CNC, and the surface is sprayed and anodized, which is durable and has a more textured overall.</span></li><li><span style=\"color:rgb(15,17,17);\">🌸【After-Sales Service】Our products come with 1-year warranty and 30-day money back guarantee. If the product has any problem, please feel free to contact us.</span></li></ul>', '', 'VIJIM LS08 Flexible Overhead Camera Mount Desk Stand, Webcam Stand Microphone Boom Arm Tabletop Photography Videography Live Stream Table clamp Mount', 'VIJIM LS08 Flexible Overhead Camera Mount Desk Stand, Webcam Stand Microphone Boom Arm Tabletop Photography Videography Live Stream Table clamp Mount', 'VIJIM LS08 Flexible Overhead Camera Mount Desk Stand, Webcam Stand Microphone Boom Arm Tabletop Photography Videography Live Stream Table clamp Mount', 'VIJIM, LS08, Flexible, Overhead, Camera, Mount, Desk, Stand,, Webcam, Stand, Microphone, Boom, Arm, Tabletop, Photography, Videography, Live, Stream, Table, clamp, Mount', 0, NULL, 'abc.com', 2, 510.5, 'pcc', 100, 1, 1, 0, 'abc.com', 10.00, 1, 1, 0, 1, 10.00000, '5', 1, '5', 1, '/backend/files/biBbfkqi92lJwYRfgDNz.jpg', 1, 1, NULL, NULL),
