nctional camera bag is professionally designed for DSLR / SLR / Mirrorless cameras of different brands. Compatible with Nikon D5600, D5300, D3500, D3400, D3300, D3200; compatible with Canon EOS Rebel T6, T6i, SL2 and other standard-size DSLRs. Also designed to be compatible with DJI Mavic Drone(Mavic 2/Air/Pro).</span></li></ul>', '', 'MOSISO Camera Backpack, DSLR/SLR/Mirrorless Photography Camera Bag 15-16 inch Waterproof Hardshell Case with Tripod Holder&Laptop Compartment Compatible with Canon/Nikon/Sony, Wine Red', 'MOSISO Camera Backpack, DSLR/SLR/Mirrorless Photography Camera Bag 15-16 inch Waterproof Hardshell Case with Tripod Holder&Laptop Compartment Compatible with Canon/Nikon/Sony, Wine Red', 'MOSISO Camera Backpack, DSLR/SLR/Mirrorless Photography Camera Bag 15-16 inch Waterproof Hardshell Case with Tripod Holder&Laptop Compartment Compatible with Canon/Nikon/Sony, Wine Red', 'MOSISO, Camera, Backpack,, DSLR/SLR/Mirrorless, Photography, Camera, Bag, 15-16, inch, Waterproof, Hardshell, Case, with, Tripod, Holder&Laptop, Compartment, Compatible, with, Canon/Nikon/Sony,, Wine, Red', 0, NULL, 'abc.com', 2, 510.5, 'pc', 100, 1, 1, 0, 'abc.com', 10.00, 1, 1, 0, 1, 10.00000, '5', 1, '5', 1, '/backend/files/0muGWwXkifechibt4qj1.jpg', 1, 1, NULL, NULL);
