ta 1.15L drinking water', 'Fanta 1.15L drinking water', 'Fanta,1.15L,, drinking, water,', 6, 'Fanta 1.15L drinking water', '', 1, 510.5, 'Case', 1, 1, 2, 0, '', 2.00, 2, 3, 0, 0, 50.00000, '18', 1, '0', 1, '/backend/files/BS1StUSJudv6zFg0ZWfq.jpg', 1, 1, NULL, '2024-03-15 10:10:02'),
